New Shooter's Edge Tactical scope. The scope is in the original packing and has never been mounted. Received it as a present but never used it. I have another Shooter's Edge scope (but x24 magnification) on my Rem 700 308 and it works perfectly for the money on this heavy recoil caliber. I has not had a need to re-zero since I have sighted it the first time. 

Original price is $156 @ Vance's!  Never montted and taken out of pacling only to take a picture.

Model: 6-18-x50 IRG

* Fully multi-coated optical system; 
* Imperial model; 
* Side focus parallax; 
* 30mm mono tube; 
* 1/8 M.O.A @ 100yds; 
* Locking fast focus; 
* Lens covers; 
* Nitrogen purged; 
* Waterproof, fog proof and shockproof; 
* Spring gun rated; 
* Range finder with red and green illumination Reticle; 
* Red / Green Illumination; 
* Can be used for accurate range finding at 10x magnification; 
* Ideal for long / shot range shooting; 
* Matte Black Finish.

450.00 or best offer.

